import logo from "../logo.svg";
import React, { Component } from "react";

class HeaderComponent extends Component {
  constructor(props) {
    super(props);

    this.state = {};
  }

  addStudent() {
    this.props.history.push("add-student/_add");
  }

  render() {
    return (
      <div>
        <header>
          <nav className="navbar navbar-expand-md navbar-dark bg-dark"> <button className="btn btn-primary" onClick={this.addStudent.bind(this)}>
              Add Student
            </button></nav>
          <div>
            <h1 className="text-center">
              <img
                src={logo}
                style={({ Height: 50 }, { width: 50 })}
                className="App-logo"
                alt="logo"
              />
              Student Management Application
            </h1>
          </div>

          <div >
           
          </div>
        </header>
      </div>
    );
  }
}
export default  HeaderComponent;
